pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

abstract contract IPartyPort{
    function transferCaptain(address newCaptain) external virtual returns (bool);
}

/**
 * @dev Party contract that is created from PirateParty
 * 
 * deposit into Party for respective Party Token
 */
contract Party is ERC20, Ownable{
    address public port;                            // contract that instantiated party
    mapping(address => bool) public inParty;        // mapping of token is in the party
    mapping(address => uint) public allocations;    // recorded balance of tokens in the portfolio
    address[] public tokens;                        // list of unique tokens
    address public immutable factory;               // pair factory initialized from router for referencing
    address public immutable router;                // DEX router to utilize for swap and pricing

    modifier isOrigin(){
        require(msg.sender == tx.origin, "msg.sender NOT tx.origin");
        _;
    }

    constructor(address _captain, string memory _name, string memory _symbol, address _router, address[] memory _tokens) ERC20(_name, _symbol){
        port = msg.sender;
        router = _router;
        factory = IUniswapV2Router02(_router).factory();

        // initialize the list of tokens and respective balance
        uint length = tokens.length;
        for(uint i; i < length; ++i){
            if(!inParty[_tokens[i]]){
                tokens.push(_tokens[i]);
                inParty[_tokens[i]] = true;
            }
        }

        // owner should not be factory
        _transferOwnership(_captain);
    }

    /**
     * @dev deposit and distribute tokens to a party
     *
     * @param token - send assets to portfolio to distribute accross
     * @param amount - amount of token to deposit
     */
    function deposit(address token, uint amount) external isOrigin {
        require(inParty[token], "Token provided is not part of the Party. Who do you even know here?");
        require(amount > 0, "Oh what? No tokens? Get outta here!");
        // make deposit
        uint256 prevBal = ERC20(token).balanceOf(address(this));
        ERC20(token).transferFrom(msg.sender, address(this), amount);
        uint256 deposited = ERC20(token).balanceOf(address(this)) - prevBal;
        
        //distribute funds accross party
        uint distribute = deposited / tokens.length;    // deposited token will have any remainder dust
        uint length = tokens.length;
        for(uint i; i < length; ++i){
            if(tokens[i]==token) continue;  //don't transfer to same token
            _edit(token, tokens[i], distribute);
        }

        uint shares = _calcShares(token, amount);
        // mit with Party reward tokens
        _mint(msg.sender, shares);
    }

    /**
     * @dev calculate number of shares in pool for given amounts
     * 
     * @param token - token to calculate shares with
     * @param amount - amount of token to get quoted
     *
     */
    function _calcShares(address token, uint amount) internal view returns (uint shares) {
        address weth = IUniswapV2Router02(router).WETH();   // base calculation on eth amount
        uint total;
        uint val;
        uint amtWeth;

        // calculate total value of portfolio in WETH
        uint length = tokens.length;
        for(uint i; i < length; ++i){
            address pair = IUniswapV2Factory(factory).getPair(tokens[i], weth);
            (uint res0, uint res1,) = IUniswapV2Pair(pair).getReserves();  
            if(IUniswapV2Pair(pair).token0() == weth){      // assume res1 will be weth
                uint temp = res0;
                res0 = res1;
                res1 = temp;
            }
            uint balance = IERC20(tokens[i]).balanceOf(address(this));
            val = IUniswapV2Router02(router).getAmountOut(balance, res0, res1);  // calculate exchange for token in weth

            if (tokens[i] == token){
                amtWeth = IUniswapV2Router02(router).getAmountOut(amount, res0, res1);  // value of deposit in weth
            }

            total += val;  // get total value of party in WETH
        }
        
        // return portion of asset WETH value provided
        shares = amtWeth / total;
    }

    /**
     * @dev withraws value from party
     *
     * @param amount - number of tokens to redeem for share
     */
    function withdraw(uint amount) external isOrigin {
        require(amount > 0, "Must withdraw something!");
        //transfer stake owed
        uint length = tokens.length;
        for(uint i; i < length; ++i){
            ERC20(tokens[i]).transfer(msg.sender, ERC20(tokens[i]).balanceOf(address(this)) * amount / totalSupply() * allocations[tokens[i]]);
        }
        //remove liquidity
        _burn(msg.sender, amount);
    }

    /**
     * @dev Owner to swap amount of held token for another
     *
     * @param from - token swapping
     * @param to - token recieving
     * @param tokenAmount - number of `from` tokens to swap
     */
    function edit(address from, address to, uint256 tokenAmount) external onlyOwner {
        _edit(from, to, tokenAmount);
    }

    /**
     * @dev interal swap amount of held token for another
     *
     * @param from - token swapping
     * @param to - token recieving
     * @param tokenAmount - number of `from` tokens to swap
     */
    function _edit(address from, address to, uint tokenAmount) internal {
        address[] memory path = new address[](3);
        path[0] = from;
        path[1] = IUniswapV2Router02(router).WETH();
        path[2] = to;

        ERC20(from).approve(router, tokenAmount);

        // make the swap
        IUniswapV2Router02(router).swapExactTokensForTokens(
            tokenAmount,
            0, // accept any amount of tokens
            path,
            address(this),
            block.timestamp
        );

        //record balance after swap
        allocations[from] = ERC20(from).balanceOf(address(this));
        allocations[to] = ERC20(to).balanceOf(address(this));
    }

    /**
     * @dev match recorded token allocation balance with actual network balance
     */
    function refresh() external {
        uint length = tokens.length;
        for(uint i; i < length; ++i){
            allocations[tokens[i]] = ERC20(tokens[i]).balanceOf(address(this));
        }
    }

    /**
     * @dev override transferOwnership of Ownable library to sync with main Pirate Party contract
     *
     * @param newOwner - new address to gain ownership, can be address(0)
     */
    function transferOwnership(address newOwner) public override onlyOwner isOrigin{
        require(IPartyPort(port).transferCaptain(newOwner), "Mutiny failed...");
        _transferOwnership(newOwner);
    }
}

/**
 * @dev PartyPort contract
 * factory to create Parties with specified params
 */
contract PartyPort is IPartyPort{
    mapping(address => address[]) public getPartiesByOwner;     // query owner address for list of controlled party addresses
    mapping(address => address) public getOwnerByParty;         // query party address for owner address
    address[] public allParties;                                // address list of all created parties
    address public immutable router;                            // DEX router to utilize for swap and pricing
                                                                // BSC:         pancakeswap 0x10ED43C718714eb63d5aA57B78B54704E256024E
                                                                // BSC testnet: pancakeswap 0xD99D1c33F9fC3444f8101754aBC46c52416550D1
                                                                // ETH:         uniswap     0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D  (includes Ropsten, Rinkeby, GÃ¶rli, and Kovan testnets)
    
    event PartyStarted(uint, address);

    constructor(address _router){
        router = _router;
    }

    function totalParties() external view returns(uint){
        return allParties.length;
    }

    function ownedParties(address owner) public view returns(uint){
        return getPartiesByOwner[owner].length;
    }

    // wtf is memory    
    function getAllParties() external view returns(address[] memory){
        return allParties;
    }


    /**
     * @dev instantiate a new Party
     *
     * @param tokens - addresses of tokens to include in portfolio
     */
    function startParty(address[] calldata tokens) external {
        require(tokens.length > 1, "Need more than one token in part!");

        // Instantiate new Party w/ params
        Party newParty = new Party(tx.origin,
                                    string(abi.encodePacked("Pirate Party Token #", Strings.toString(allParties.length))),
                                    string(abi.encodePacked("PPT", Strings.toString(allParties.length))),
                                    router,
                                    tokens);

        // Save Party information
        getPartiesByOwner[msg.sender].push(address(newParty));
        getOwnerByParty[address(newParty)] = msg.sender;
        allParties.push(address(newParty));

        emit PartyStarted(allParties.length, msg.sender);
    }

    function transferCaptain(address newCaptain) external override returns(bool){
        address captain = getOwnerByParty[msg.sender];              // actual party owner
        address[] memory parties = getPartiesByOwner[tx.origin];    // check tx.origin and owned parties
        uint length = parties.length;
        for(uint i; i < length; ++i){
            if(msg.sender == parties[i]){
                // update storage of previous captain 
                getPartiesByOwner[captain][i] = parties[length - 1];
                getPartiesByOwner[captain].pop();

                // assign new party information
                getPartiesByOwner[newCaptain].push(msg.sender);
                getOwnerByParty[msg.sender] = newCaptain;

                return true;    // successful a transfer of ownership
            }
        }
        return false;   // tx.origin was not owner of party
    }
}

